# ISSUE: When Windows is configured to auto login a user, that users credentials are stored in clear text in the registry
# SOLUTION: Run this script to use the SysInternals utility Autologon to encrypt the password value in the registry and hide it from malicious actors
# DOWNLOAD LINK: https://docs.microsoft.com/en-us/sysinternals/downloads/autologon

Write-Output "[*] Checking to see if autologin is already configured using a clear text password"
$AutoLoginCreds = Get-ItemProperty -Path "HKLM:\SOFTWARE\Microsoft\Windows NT\Currentversion\Winlogon" | Select-Object -Property "DefaultUserName","DefaultPassword"
If (($AutoLoginCreds).DefaultPassword) {

    Write-Output "[*] Obtained autologin credentials from the registry"
    $User = $AutoLoginCreds.DefaultUserName
    $Password = $AutoLoginCreds.DefaultPassword

} Else {

    Write-Output "[*] Credentials required for autologin"
    $Credential = Get-Credential -Message "Enter the credentials of the auto login user"
    $User = $Credential.Username
    $Password = $Credential.GetNetworkCredential().Password

}  # End If Else

Switch -Wildcard ($User) {

    "*@*" { $Domain = $User.Split("@")[-1] }
    "*\*" { $Domain = $User.Split("\")[0] }
    Default { $Domain = Read-Host -Prompt "Enter a Domain for the autologin account `nEXAMPLE: domain.com : " }

}  # End Switch

If ($Domain.Length -lt 2) {

    $Domain = $env:USERDOMAIN

}  # End If


$FilePath = "$env:TEMP\autologon.exe" 
If (!(Test-Path -Path $FilePath)) {

    Write-Output "[*] Creating the autologon.exe file from base64"
    $Base64 = ''
    [IO.File]::WriteAllBytes($FilePath, [Convert]::FromBase64String($Base64))

}  # End If

Start-Process -FilePath $FilePath -ArgumentList @("/accepteula", $User, $Domain, $Password) -Wait
